// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title RevocationRegistry
 * @dev Blockchain-based Certificate Revocation List (CRL) system
 * @notice This contract allows Certificate Authorities to revoke certificates
 * and enables clients to verify certificate status in near real-time
 */
contract RevocationRegistry {
    struct RevocationInfo {
        string issuerId;
        uint256 timestamp;
        bool revoked;
    }

    mapping(bytes32 => RevocationInfo) private revocations;

    mapping(address => bool) private authorizedCAs;

    address private owner;

    event RevocationEvent(bytes32 indexed serialNumber, string issuerId, uint256 timestamp);
    event CAAuthorized(address indexed caAddress);
    event CADeauthorized(address indexed caAddress);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can call this function");
        _;
    }

    modifier onlyAuthorizedCA() {
        require(authorizedCAs[msg.sender], "Only authorized CAs can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function authorizeCA(address caAddress) external onlyOwner {
        authorizedCAs[caAddress] = true;
        emit CAAuthorized(caAddress);
    }

    function deauthorizeCA(address caAddress) external onlyOwner {
        authorizedCAs[caAddress] = false;
        emit CADeauthorized(caAddress);
    }

    function isAuthorizedCA(address caAddress) external view returns (bool) {
        return authorizedCAs[caAddress];
    }

    function revokeCertificate(
        bytes32 serialNumber,
        string calldata issuerId,
        uint256 timestamp
    ) external onlyAuthorizedCA {
        require(!revocations[serialNumber].revoked, "Certificate already revoked");

        revocations[serialNumber] = RevocationInfo({
            issuerId: issuerId,
            timestamp: timestamp,
            revoked: true
        });

        emit RevocationEvent(serialNumber, issuerId, timestamp);
    }

    function isRevoked(bytes32 serialNumber) external view returns (bool) {
        return revocations[serialNumber].revoked;
    }

    function getRevocationDetails(bytes32 serialNumber) 
        external 
        view 
        returns (string memory issuerId, uint256 timestamp, bool revoked) 
    {
        RevocationInfo memory info = revocations[serialNumber];
        return (info.issuerId, info.timestamp, info.revoked);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "New owner cannot be the zero address");
        owner = newOwner;
    }
}

